export function AuthEntitlementToAuthType(entitlement) {
    switch (entitlement) {
        case 'AUTH':
            return 'jwt';
        case 'USER_AUTH':
            return 'jwt';
        case 'AUTH_OAUTH':
            return 'oauth';
        case 'AUTH_PASSWORD':
            return 'password';
        case 'AUTH_JWT':
            return 'jwt';
        case 'AUTH_MINTLIFY':
            return 'mintlify';
        case 'PERSONALIZATION_JWT':
            return 'jwt';
        case 'PERSONALIZATION_OAUTH':
            return 'oauth';
        case 'PERSONALIZATION_SHARED_SESSION':
            return 'shared-session';
    }
}
